import React from "react";

const Navbar = ({ title, icon }) => {
  return (
    <div className="navbar bg-danger">
      <h1>
        <i className={icon} /> {title}
      </h1>
    </div>
  );
};

Navbar.defaultProps = {
  title: "Movie Finder",
  icon: "fas fa-id-card-alt",
};
export default Navbar;
